DROP TABLE NHANSU cascade constraints;
DROP TABLE SINHVIEN cascade constraints;
DROP TABLE DONVI cascade constraints;
DROP TABLE HOCPHAN cascade constraints;
DROP TABLE KHMO cascade constraints;
DROP TABLE PHANCONG cascade constraints;
DROP TABLE DANGKY cascade constraints;
--------------------------------------------------------------------------------
-- Create table
CREATE TABLE NHANSU (
    MANV VARCHAR2(10) PRIMARY KEY,
    HOTEN VARCHAR2(100),
    PHAI VARCHAR2(5),
    NGSINH DATE,
    PHUCAP NUMBER,
    DT VARCHAR2(20),
    VAITRO VARCHAR2(50),
    MADV VARCHAR2(10)
);

CREATE TABLE SINHVIEN (
    MASV VARCHAR2(10) PRIMARY KEY,
    HOTEN VARCHAR2(100),
    PHAI VARCHAR2(5),
    NGSINH DATE,
    DCHI VARCHAR2(200),
    DT VARCHAR2(20),
    MACT VARCHAR2(10),
    MANGANH VARCHAR2(10),
    SOTCTL NUMBER,
    DTBTL NUMBER
);

CREATE TABLE DONVI (
    MADV VARCHAR2(10) PRIMARY KEY,
    TENDV VARCHAR2(100),
    TRGDV VARCHAR2(10)
);

CREATE TABLE HOCPHAN (
    MAHP VARCHAR2(10) PRIMARY KEY,
    TENHP VARCHAR2(100),
    SOTC NUMBER,
    STLT NUMBER,
    STTH NUMBER,
    SOSVTD NUMBER,
    MADV VARCHAR2(10)
);

CREATE TABLE KHMO (
    MAHP VARCHAR2(10),
    HK NUMBER,
    NAM NUMBER,
    MACT VARCHAR2(10),
    PRIMARY KEY (MAHP, HK, NAM, MACT)
);

CREATE TABLE PHANCONG (
    MAGV VARCHAR2(10),
    MAHP VARCHAR2(10),
    HK NUMBER,
    NAM NUMBER,
    MACT VARCHAR2(10),
    PRIMARY KEY (MAGV, MAHP, HK, NAM, MACT)
);

CREATE TABLE DANGKY (
    MASV VARCHAR2(10),
    MAGV VARCHAR2(10),
    MAHP VARCHAR2(10),
    HK NUMBER,
    NAM NUMBER,
    MACT VARCHAR2(10),
    DIEMTH NUMBER,
    DIEMQT NUMBER,
    DIEMCK NUMBER,
    DIEMTK NUMBER,
    PRIMARY KEY (MASV, MAGV, MAHP, HK, NAM, MACT)
);

--------------------------------------------------------------------------------
-- Them khoa ngoai
ALTER TABLE NHANSU
ADD CONSTRAINT FK_NHANSU_DONVI FOREIGN KEY (MADV) REFERENCES DONVI(MADV);

ALTER TABLE DONVI
ADD CONSTRAINT FK_DONVI_NHANSU FOREIGN KEY (TRGDV) REFERENCES NHANSU(MANV);

ALTER TABLE HOCPHAN
ADD CONSTRAINT FK_HOCPHAN_DONVI FOREIGN KEY (MADV) REFERENCES DONVI(MADV);

ALTER TABLE KHMO
ADD CONSTRAINT FK_KHMO_HOCPHAN FOREIGN KEY (MAHP) REFERENCES HOCPHAN(MAHP);

ALTER TABLE PHANCONG
ADD CONSTRAINT FK_PHANCONG_NHANSU FOREIGN KEY (MAGV) REFERENCES NHANSU(MANV);
ALTER TABLE PHANCONG
ADD CONSTRAINT FK_PHANCONG_KHMO FOREIGN KEY (MAHP, HK, NAM, MACT) REFERENCES KHMO(MAHP, HK, NAM, MACT);

ALTER TABLE DANGKY
ADD CONSTRAINT FK_DANGKY_SINHVIEN FOREIGN KEY (MASV) REFERENCES SINHVIEN(MASV);
ALTER TABLE DANGKY
ADD CONSTRAINT FK_DANGKY_PHANCONG FOREIGN KEY (MAGV, MAHP, HK, NAM, MACT) REFERENCES PHANCONG(MAGV, MAHP, HK, NAM, MACT);
